/* globals PS : true */

"use strict"; // Do NOT remove this directive!

let BG_COLOR = 0x050505;
let TEXT_COLOR = 0xf0f0f0;
let PLAYER_COLOR = 0x80C0B0;


/*
PS.init( system, options )
Called once after engine is initialized but before event-polling begins.
This function doesn't have to do anything, although initializing the grid dimensions with PS.gridSize() is recommended.
If PS.grid() is not called, the default grid dimensions (8 x 8 beads) are applied.
Any value returned is ignored.
[system : Object] = A JavaScript object containing engine and host platform information properties; see API documentation for details.
[options : Object] = A JavaScript object with optional data properties; see API documentation for details.
*/

PS.init = function(system, options ) {
	PS.gridSize(32, 32);
	PS.statusColor(TEXT_COLOR);
	PS.gridColor(BG_COLOR);
	PS.border(PS.ALL, PS.ALL, 0);
	PS.borderColor(PS.ALL, PS.ALL, 0xC0C0C0);
	PS.color(PS.ALL, PS.ALL, BG_COLOR);
	changeMap();
	PS.timerStart(1, gameLoop);
	// Preload audio files
	PS.audioLoad("door_open", {path: "audio/"});
	PS.audioLoad("door_close", {path: "audio/"});
};

let gameTimer = 0;
function gameLoop () {
	gameTimer += 1;
	erase();
	gameLogic();
	render();
}

let needToResetDarkness = true;
let needToUpdateBackground = true;
let needToUpdateMusic = false;
function erase () {
	if (needToUpdateBackground) {
		PS.gridPlane(0);
		PS.imageBlit(currentMap, 0, 0);
		needToUpdateBackground = false;
	}
	if (needToResetDarkness) {
		resetDarkness();
		needToResetDarkness = false;
	}
	PS.gridPlane(1);
	PS.alpha(xPlayer, yPlayer, 0);
	// Erase other entities
	if (currentMap.entities !== undefined) {
		currentMap.entities.forEach(entity => {
			PS.alpha(entity.x, entity.y, 0);
			if (entity.name === "bedroom_plank") {
				PS.alpha(entity.x + 1, entity.y, 0);
			}
		});
	}
	if (needToUpdateMusic) {
		updateMusic();
	}
}

// Player position and movement
let xPlayer = 15;
let yPlayer = 15;
let moveDelay = 0;

// Mouse position
let xMouse = 15;
let yMouse = 15;

// Map info
let currentMap = undefined;
let xMap = 7;
let yMap = 31;

// Game state
let holdingCandle = false;
let candleRadius = 4.4;
let holdingFlashlight = false;

// Enter the house
let entryDoorLocked = true;

// Reach the 2nd floor
let stairsDoorLocked = true;

function gameLogic () {
	if (moveDelay > 0) {
		moveDelay -= 1;
	}
	else {
		let xDelta = 0;
		let yDelta = 0;
		if (upPressed) {
			yDelta -= 1;
		}
		if (downPressed) {
			yDelta += 1;
		}
		if (leftPressed) {
			xDelta -= 1;
		}
		if (rightPressed) {
			xDelta += 1;
		}
		if (xDelta !== 0 || yDelta !== 0) {
			let xTarget = xPlayer + xDelta;
			let yTarget = yPlayer + yDelta;
			if (xTarget <= 0) {
				xTarget = 0;
			}
			if (yTarget <= 0) {
				yTarget = 0;
			}
			if (xTarget >= 31) {
				xTarget = 31;
			}
			if (yTarget >= 31) {
				yTarget = 31;
			}
			let doorIsLocked = false;
			if (currentMap.lockedDoorFunction !== undefined) {
				doorIsLocked = currentMap.lockedDoorFunction();
			}
			let tileTarget = currentMap.tile[xTarget + yTarget * 32];
			if (tileTarget === 1 || (doorIsLocked && tileTarget === 4)) {
				// Blocked, can't move here
				// Try keeping current X position
				tileTarget = currentMap.tile[xPlayer + yTarget * 32];
				if (tileTarget === 1 || (doorIsLocked && tileTarget === 4)) {
					// Blocked, can't move here
					// Try keeping current Y position
					tileTarget = currentMap.tile[xTarget + yPlayer * 32];
					if (tileTarget === 1 || (doorIsLocked && tileTarget === 4)) {
						// Blocked, can't move here
						// Give up
						xDelta = 0;
						yDelta = 0;
					}
					else {
						// New target is good, use it
						yDelta = 0;
					}
				}
				else {
					// New target is good, use it
					xDelta = 0;
				}
			}
			else {
				// Initial tile target was good
			}
			xPlayer += xDelta;
			yPlayer += yDelta;
			if (xPlayer <= 0) {
				xPlayer = 0;
			}
			if (yPlayer <= 0) {
				yPlayer = 0;
			}
			if (xPlayer >= 31) {
				xPlayer = 31;
			}
			if (yPlayer >= 31) {
				yPlayer = 31;
			}
			moveDelay = 5;
			// Check for trigger points at the new player location
			triggerList.forEach(triggerPoint => {
				if (xPlayer === triggerPoint.x && yPlayer === triggerPoint.y) {
					if (currentMap.triggerFunction !== undefined) {
						currentMap.triggerFunction();
					}
				}
			});
		}
	}
	// Interactions
	if (interactPressed && interactReleased) {
		interactReleased = false;
		// Picking up a candle
		if (!holdingCandle) {
			candleList.forEach(candle => {
				let inRange = Math.abs(xPlayer - candle.x) <= 1 && Math.abs(yPlayer - candle.y) <= 1;
				if (inRange && !holdingCandle) {
					holdingCandle = true;
					currentMap.tile[candle.x + candle.y * 32] = 0;
					currentMap.data[candle.x + candle.y * 32] = 0x333645;
					PS.statusText("I picked up a candle.");
					updateImportantTiles();
					needToUpdateBackground = true;
				}
			});
		}
		// Interact at interact points
		interactList.forEach(interactPoint => {
			if (xPlayer === interactPoint.x && yPlayer === interactPoint.y) {
				if (currentMap.interactFunction !== undefined) {
					currentMap.interactFunction();
				}
			}
		});
	}
	
	// Move between map spaces
	let movedMap = false;
	if (yPlayer === 0 && yMap > 0) {
		yMap -= 1;
		yPlayer = 30;
		movedMap = true;
	}
	else if (yPlayer === 31 && yMap < 31) {
		yMap += 1;
		yPlayer = 1;
		movedMap = true;
	}
	else if (xPlayer === 0 && xMap > 0) {
		xMap -= 1;
		xPlayer = 30;
		movedMap = true;
	}
	else if (xPlayer === 31 && xMap < 31) {
		xMap += 1;
		xPlayer = 1;
		movedMap = true;
	}
	if (movedMap) {
		changeMap();
	}
}

let musicTrackChannels = {};
let currentMusic = undefined;

function changeMap () {
	currentMap = mapGrid[xMap + yMap * 32];
	PS.statusText(currentMap.text);
	if (editMode) {
		updateEditMapFull();
	}
	updateImportantTiles();
	needToResetDarkness = true;
	needToUpdateBackground = true;
	updateMusic();
}

let musicVolume = 0.15;
function updateMusic () {
	let newMusic = areaToMusic[currentMap.area];
	if (newMusic !== currentMusic) {
		if (currentMusic !== undefined) {
			let currentChannel = musicTrackChannels[currentMusic];
			//console.log("starting music fade out " + currentMusic);
			if (currentChannel !== undefined) {
				PS.audioFade(currentChannel, musicVolume, 0, PS.DEFAULT, (channel) => {
					//console.log("ending music fade out");
					//PS.audioStop(channel);
					currentMusic = undefined;
					updateMusic();
				});
			}
			else {
				console.log("Music issue - channel wasn't determined before trying to fade it out");
				needToUpdateMusic = true;
			}
		}
		else {
			if (musicTrackChannels[newMusic] !== undefined) {
				let newChannel = musicTrackChannels[newMusic];
				PS.audioPlayChannel(newChannel, {volume: musicVolume, loop: true});
				//console.log("playing music that was already turned into a channel " + newMusic);
			}
			else {
				//console.log("playing music for the first time " + areaToMusic[currentMap.area]);
				PS.audioLoad(areaToMusic[currentMap.area], {autoplay: true, volume: musicVolume, loop: true, lock: true, path: "audio/", onLoad: (loadObject) => {
					musicTrackChannels[loadObject.name] = loadObject.channel;
				}});
			}
			currentMusic = newMusic;
		}
	}
}

function render () {
	PS.gridPlane(1);
	// Draw entities
	if (currentMap.entities !== undefined) {
		currentMap.entities.forEach(entity => {
			let shouldDrawEntity = true;
			if (entity.hiddenWhenDark) {
				let darknessState = darknessMap[entity.x + entity.y * 32];
				if (darknessState === true) {
					shouldDrawEntity = false;
				}
			}
			if (shouldDrawEntity) {
				PS.alpha(entity.x, entity.y, 255);
				PS.color(entity.x, entity.y, entity.color);
				if (entity.name === "bedroom_plank") {
					PS.alpha(entity.x + 1, entity.y, 255);
					PS.color(entity.x + 1, entity.y, entity.color);
				}
			}
		});
	}
	// Draw player
	PS.alpha(xPlayer, yPlayer, 255);
	PS.color(xPlayer, yPlayer, PLAYER_COLOR);
	// Candles in "shadow" layer above the base plane
	updateDarkness();
}

let darknessMap = Array(1024).fill(true);
let newDarknessMap = Array(1024).fill(true);

function resetDarkness () {
	PS.gridPlane(2);
	PS.alpha(PS.ALL, PS.ALL, currentMap.darkness || 100);
	PS.color(PS.ALL, PS.ALL, 0x000000);
	darknessMap = Array(1024).fill(true);
}

function updateDarkness () {
	PS.gridPlane(2);
	newDarknessMap = Array(1024).fill(true);
	candleList.forEach((candle, index) => {
		let targetRadius = 4.1 + Math.sin((gameTimer + index * 100) / 100) * 0.6 + Math.random() * 0.4;
		candle.radius = candle.radius * 0.95 + targetRadius * 0.05;
		candleCircle(candle.x, candle.y, candle.radius);
	});
	if (holdingCandle) {
		let targetRadius = 4.1 + Math.sin(gameTimer / 100 + 789) * 0.6 + Math.random() * 0.4;
		candleRadius = candleRadius * 0.95 + targetRadius * 0.05;
		candleCircle(xPlayer, yPlayer, candleRadius);
	}
	// Flashlight goes here
	newDarknessMap.forEach((item, index) => {
		if (item !== darknessMap[index]) {
			darknessMap[index] = item;
			let xTile = index % 32;
			let yTile = Math.floor((index - xTile) / 32);
			if (item === true) {
				PS.alpha(xTile, yTile, currentMap.darkness);
			}
			else {
				PS.alpha(xTile, yTile, 0);
			}
		}
	});
}

function candleCircle (x, y, radius) {
	// Set alpha to 0 for tiles within light radius of the candle
	// Editing alpha for the "shadow" layer, not the main tile layer
	// Loop x
	let intRadius = Math.ceil(radius)
	for (let i = x - intRadius; i < x + intRadius + 1; i++) {
		// Loop y
		for (let j = y - intRadius; j < y + intRadius + 1; j++) {
			// Check if within bounds of screen
			if (i >= 0 && j >= 0 && i <= 31 && j <= 31) {
				// Check if inside circle
				if (Math.sqrt((x - i) ** 2 + (y - j) ** 2) <= radius) {
					//PS.alpha(i, j, 0);
					newDarknessMap[i + j * 32] = false;
				}
			}
		}
	}
}

let candleList = [];
let interactList = [];
//let lockedDoorList = [];
let triggerList = [];
function updateImportantTiles () {
	candleList = [];
	interactList = [];
	//lockedDoorList = [];
	triggerList = [];
	currentMap.tile.forEach((tile, index) => {
		if (tile > 1) {
			let xTile = index % 32;
			let yTile = Math.floor((index - xTile) / 32);
			if (tile === 2) {
				// Candle
				candleList.push({x: xTile, y: yTile, radius: 4.4});
			}
			if (tile === 3) {
				// Interact Point
				interactList.push({x: xTile, y: yTile});
			}
			/*if (tile === 4) {
				// Locked Door
				lockedDoorList.push({x: xTile, y: yTile});
			}*/
			if (tile === 5) {
				// Trigger point
				triggerList.push({x: xTile, y: yTile});
			}
		}
	});
}

