	// Uncomment the following code line to inspect x/y parameters:

	// PS.debug( "PS.enter() @ " + x + ", " + y + "\n" );

	// Add code here for when the mouse cursor/touch enters a bead.
	xMouse = x;
	yMouse = y;
	if (editMode) {
		if (editTouching) {
			editTile(x, y, editNum);
		}
	}
