// Pressed input keys
let upPressed = false;
let downPressed = false;
let leftPressed = false;
let rightPressed = false;
let interactPressed = false;
// Released input keys
let upReleased = true;
let downReleased = true;
let leftReleased = true;
let rightReleased = true;
let interactReleased = true;
// Edit mode
let editMode = false;
let editTouching = false;
let editNum = 1;

/*
PS.keyDown ( key, shift, ctrl, options )
Called when a key on the keyboard is pressed.
This function doesn't have to do anything. Any value returned is ignored.
[key : Number] = ASCII code of the released key, or one of the PS.KEY_* constants documented in the API.
[shift : Boolean] = true if shift key is held down, else false.
[ctrl : Boolean] = true if control key is held down, else false.
[options : Object] = A JavaScript object with optional data properties; see API documentation for details.
*/

PS.keyDown = function(key, shift, ctrl, options) {
	// Uncomment the following code line to inspect first three parameters:

	//PS.debug("PS.keyDown(): key=" + key + ", shift=" + shift + ", ctrl=" + ctrl + "\n");

	// Add code here for when a key is pressed.
	if (key === 119 || key === 1006) {
		// W or Up
		upPressed = true;
	}
	else if (key === 115 || key === 1008) {
		// S or Down
		downPressed = true;
	}
	else if (key === 97 || key === 1005) {
		// A or Left
		leftPressed = true;
	}
	else if (key === 100 || key === 1007) {
		// D or Right
		rightPressed = true;
	}
	else if (key === 122 || key === 120 || key === 32 || key === 13) {
		// Z, X, Space, Enter
		interactPressed = true;
	}
	else if (key === 112) {
		// P
		// Edit mode
		if (editMode) {
			editMode = false;
			editTouching = false;
			PS.statusText("Done with edit mode");
			PS.debug(exportTileData());
			PS.border(PS.ALL, PS.ALL, 0);
		}
		else {
			editMode = true;
			PS.statusText("Edit Mode - press P again to export");
			editNum = 1;
			updateEditMapFull();
		}
	}
	else if (key === 48) {
		// 0
		if (editMode) {
			PS.statusText("0 - nothing");
			editNum = 0;
		}
	}
	else if (key === 49) {
		// 1
		if (editMode) {
			PS.statusText("1 - wall");
			editNum = 1;
		}
	}
	else if (key === 50) {
		// 2
		if (editMode) {
			PS.statusText("2 - candle");
			editNum = 2;
		}
	}
	else if (key === 51) {
		// 3
		if (editMode) {
			PS.statusText("3 - interact point");
			editNum = 3;
		}
	}
	else if (key === 52) {
		// 4
		if (editMode) {
			PS.statusText("4 - locked door");
			editNum = 4;
		}
	}
	else if (key === 53) {
		// 5
		if (editMode) {
			PS.statusText("5 - trigger point");
			editNum = 5;
		}
	}
	else if (key === 54) {
		// 6
		if (editMode) {
			PS.statusText("6 - nothing");
			editNum = 6;
		}
	}
	else if (key === 55) {
		// 7
		if (editMode) {
			PS.statusText("7 - nothing");
			editNum = 7;
		}
	}
	else if (key === 56) {
		// 8
		if (editMode) {
			PS.statusText("8 - nothing");
			editNum = 8;
		}
	}
	else if (key === 57) {
		// 9
		if (editMode) {
			PS.statusText("9 - nothing");
			editNum = 9;
		}
	}
	else if (key === 96) {
		// ~ Tilde: Skip to location of interest (Dev button, disable for normal gameplay)
		// Center room bottom floor
		// xMap = 7;
		// yMap = 28;
		// Second floor landing
		xMap = 8;
		yMap = 21;
		changeMap();
	}
	else if (key === 61) {
		// + Plus: Toggle 3D mode
		enable3DMode = !enable3DMode;
		if (enable3DMode) {
			document.getElementsByClassName("threejs_canvas")[0].style.opacity = 1;
		}
		else {
			document.getElementsByClassName("threejs_canvas")[0].style.opacity = 0;
		}
	}
};

let enable3DMode = false;

/*
PS.keyUp ( key, shift, ctrl, options )
Called when a key on the keyboard is released.
This function doesn't have to do anything. Any value returned is ignored.
[key : Number] = ASCII code of the released key, or one of the PS.KEY_* constants documented in the API.
[shift : Boolean] = true if shift key is held down, else false.
[ctrl : Boolean] = true if control key is held down, else false.
[options : Object] = A JavaScript object with optional data properties; see API documentation for details.
*/

PS.keyUp = function(key, shift, ctrl, options) {
	// Uncomment the following code line to inspect first three parameters:

	// PS.debug( "PS.keyUp(): key=" + key + ", shift=" + shift + ", ctrl=" + ctrl + "\n" );

	// Add code here for when a key is released.
	if (key === 119 || key === 1006) {
		// W or Up
		upPressed = false;
		upReleased = true;
	}
	else if (key === 115 || key === 1008) {
		// S or Down
		downPressed = false;
		downReleased = true;
	}
	else if (key === 97 || key === 1005) {
		// A or Left
		leftPressed = false;
		leftReleased = true;
	}
	else if (key === 100 || key === 1007) {
		// D or Right
		rightPressed = false;
		rightReleased = true;
	}
	else if (key === 122 || key === 120 || key === 32 || key === 13) {
		// Z, X, Space, Enter
		interactPressed = false;
		interactReleased = true;
	}
};

