function exportTileData () {
	let exportString = "\ttile: [\n";
	for (let i = 0; i < 1024; i += 32) {
		exportString = exportString + "\t" + (currentMap.tile.slice(i, i + 32).join(", ")) + (",\n");
	}
	exportString = exportString + "\t],";
	return exportString;
}

